import React from 'react';
import Header from './../../components/header/Header.js';
import Footer from './../../components/footer/Footer.js';
import './Hangar.css';

const images = [
  'https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.simpleplanes.com%2Fa%2F99MXm4%2FAirbus-A380-841-Qantas-VH-OQA&psig=AOvVaw220TpF1UKjxm4ATPoJN2TF&ust=1684005061866000&source=images&cd=vfe&ved=0CA4QjRxqFwoTCPC15vG98P4CFQAAAAAdAAAAABAE',
  'https://example.com/image2.jpg',
  'https://example.com/image3.jpg',
  'https://example.com/image4.jpg',
  'https://example.com/image5.jpg',
  'https://example.com/image6.jpg',
  'https://example.com/image7.jpg'
];

const Hangar = () => {
  return (
    <div>
      <Header />
      <h1 className="title">SimpleFly</h1>
      <div className="image-slider">
        {images.map((image, index) => (
          <img key={index} src={image} alt="" />
        ))}
      </div>
      <Footer />
    </div>
  );
};

export default Hangar;
